import React, {useState} from 'react'
import {
  Accordion,
  AccordionItem,
  AccordionButton,
  AccordionPanel,
  AccordionIcon,
  Alert,
  AlertIcon,
  Box,
  Card,
  Container,
  Heading,
  Tab,
  Tabs,
  TabList,
  TabPanel,
  TabPanels,
  Text,
  useColorModeValue
} from '@chakra-ui/react'
import EarningsForm from '../Components/EarningsForm/earningsForm'
import ExpenseForm from '../Components/ExpenseForm/expenseForm'
import EarningsExpenseInfo from '../Components/EarningsExpenseInfo/earningsExpenseInfo'

const EternaDashboard = () => {
  const tabBackgroundColors = useColorModeValue(
    ['red.50', 'teal.50'],
    ['red.900', 'teal.900']
  )

  const [tabIndex, setTabIndex] = useState(0)
  const background = tabBackgroundColors[tabIndex]

  const updateExpenses = (newExpenseAmount) => {
    const updatedTotalExpenses = totalExpenses + parseFloat(newExpenseAmount);
    const netVsLossPercentage = updatedTotalExpenses !== 0 ? ((totalEarnings - updatedTotalExpenses) / updatedTotalExpenses) * 100 : 0;
    const changeStatArrowValue = netVsLossPercentage > 0 ? 'increase' : netVsLossPercentage === 0 ? '' : 'decrease';
    const netProfit = totalEarnings - updatedTotalExpenses;
    const changeScreenBgBasedOnNet = netVsLossPercentage === 0 ? '#ffffff' : netVsLossPercentage > 0 ? 'teal.50' : 'red.50';

    setTotalExpenses(updatedTotalExpenses);
    setTotalPercentages(netVsLossPercentage.toFixed(2));
    setNetProfits(netProfit.toFixed(2));
    setChangeStatArrow(changeStatArrowValue);
    setNumValuesBgChange(changeScreenBgBasedOnNet);
  };

  const updateEarnings = (newEarningsAmount) => {
    const updatedTotalEarnings = totalEarnings + parseFloat(newEarningsAmount);
    const netVsLossPercentage = totalExpenses !== 0 ? ((updatedTotalEarnings - totalExpenses) / totalExpenses) * 100 : 0;
    const changeStatArrowValue = netVsLossPercentage > 0 ? 'increase' : netVsLossPercentage === 0 ? '' : 'decrease';
    const netProfit = updatedTotalEarnings - totalExpenses;
    const changeScreenBgBasedOnNet = netVsLossPercentage === 0 ? '#ffffff' : netVsLossPercentage > 0 ? 'teal.50' : 'red.50';

    setTotalEarnings(updatedTotalEarnings);
    setTotalPercentages(netVsLossPercentage.toFixed(2));
    setNetProfits(netProfit.toFixed(2));
    setChangeStatArrow(changeStatArrowValue);
    setNumValuesBgChange(changeScreenBgBasedOnNet);
  }

  return(
    <Card>
      <Container p={2}>
        <Heading size='md' textAlign='center' p={2}>Welcome to Eterna Primavera Landing.</Heading>
        <Alert status='info'>
          <AlertIcon />
          This is a monetary visualization tool. An easy way to keep count of your business earnings and expesnes.
        </Alert>
      </Container>
      <Card>
        <EarningsExpenseInfo/>
      </Card>
      <Accordion defaultIndex={[0]} allowMultiple>
        <AccordionItem>
            <AccordionButton>
              <Box as="span" flex='1' textAlign='left'>
                <Heading size='md'>Earnings/Expense Forms.</Heading>
              </Box>
            <AccordionIcon />
          </AccordionButton>
        <AccordionPanel pb={1}>
          <Tabs onChange={(index) => setTabIndex(index)} background={background}>
            <TabList>
              <Tab>
                <Text fontSize='lg'>Expenses</Text>
              </Tab>
              <Tab>
              <Text fontSize='lg'>Earnings</Text>
              </Tab>
            </TabList>
            <TabPanels>
              <TabPanel>
                <ExpenseForm updateExpenses={updateExpenses}/>
              </TabPanel>
              <TabPanel>
                <EarningsForm updateEarnings={updateEarnings}/>
              </TabPanel>
            </TabPanels>
          </Tabs>
        </AccordionPanel>
      </AccordionItem>
      </Accordion>
    </Card>
  )
}

export default EternaDashboard
